(15, 8, 'vendor1', 'Nike, Inc., is one of the largest and best-recognized global sports and athleticwear brands. Its extensive lineup includes its long-running Air Jordan, Air Force 1, and other “Air” models.', '\"[\\\"vendor8/products/1756102449887-xavier-teo-SxAXphIPWeg-unsplash.jpg\\\",\\\"vendor8/products/1756102449889-andres-jasso-PqbL_mxmaUE-unsplash.jpg\\\",\\\"vendor8/products/1756102449890-domino-studio-164_6wVEHfI-unsplash.jpg\\\"]\"', '2', 'Nike Shoes', 2000, 'Features like Air Max cushioning and React foam make Nike shoes not only stylish but also some of the most comfortable Nike shoes available. These innovations reduce impact during movement, ensuring a smoother, more enjoyable experience for wearers.', 19, '2778f283-c576-4466-afdd-621a4095279b', '1', '1', '2025-08-25 06:14:09', '2025-08-25 11:56:53', NULL),
(16, 8, 'vendor1', 'The Maruti 800 was an iconic Indian hatchback known for its 796cc, 3-cylinder engine, lightweight design, and compact, 5-seater body that made it easy to maneuver in city traffic. ', '\"[\\\"vendor8/products/1756103325904-imagesasd.jpg\\\",\\\"vendor8/products/1756103325904-imagesa.jpg\\\",\\\"vendor8/products/1756103325904-images.jpg\\\"]\"', '10', 'Maruti 800', 10000, 'A 796cc, 3-cylinder petrol engine was the heart of the Maruti 800, known for its responsiveness and reliability.', 0, '5cda3acf-0d82-449a-b802-1ecb16640e52', '1', '1', '2025-08-25 06:28:45', '2025-08-25 11:58:34', NULL),
